import React, { useState } from "react";
import ScheduleTable from "../../components/ScheduleTable/ScheduleTable";
import "./OrarToti.css";

const OrarToti = () => {
  const [activeDropdown, setActiveDropdown] = useState(null); // Dropdown activ
  const [selectedYear, setSelectedYear] = useState(null); // Anul selectat
  const [selectedGroup, setSelectedGroup] = useState(null); // Grupa selectatƒÉ

  const studentYears = [
    {
      label: "Anul 1",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Anul 2",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Anul 3",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Master Anul 1",
      groups: [
        "Inteligen»õa ArtificialƒÉ »ôi Optimizare",
        "Ingineria Sistemelor Soft",
        "Lingvistica Computa»õionalƒÉ",
        "Studii Avansate √Æn InformaticƒÉ",
        "Sisteme Distribuite",
        "Securitatea Informa»õiilor",
      ],
    },
    {
      label: "Master Anul 2",
      groups: [
        "Inteligen»õa ArtificialƒÉ »ôi Optimizare",
        "Ingineria Sistemelor Soft",
        "Lingvistica Computa»õionalƒÉ",
        "Studii Avansate √Æn InformaticƒÉ",
        "Sisteme Distribuite",
        "Securitatea Informa»õiilor",
      ],
    },
  ];

  const buttons = [
    { label: "Orar studen»õi", icon: "üéì" },
    { label: "Orar profesori", icon: "üë®‚Äçüè´" },
    { label: "Orar pe discipline de studiu", icon: "üìò" },
    { label: "Orar sƒÉli »ôi alte resurse", icon: "üè¢" },
  ];

  return (
    <div className="orar-container">
      <div className="orar-titlu">
        <h1>Orar</h1>
        <h2>Alege o categorie pentru a vizualiza detalii</h2>
      </div>

      {/* Butoane principale */}
      <div className="orar-buttons">
        {buttons.map((button, index) => (
          <button
            key={index}
            className={`orar-button ${activeDropdown === index ? "active" : ""}`}
            onClick={() => {
              setActiveDropdown(activeDropdown === index ? null : index);
              setSelectedYear(null); // ResetƒÉm anul selectat
              setSelectedGroup(null); // ResetƒÉm grupa selectatƒÉ
            }}
          >
            <span className="icon">{button.icon}</span>
            {button.label}
          </button>
        ))}
      </div>

      {/* Dropdown pentru "Orar Studen»õi" */}
      {activeDropdown === 0 && (
        <div className="dropdown-menu">
          {!selectedYear ? (
            // Afi»ôƒÉm anii »ôi masterele
            <ul>
              {studentYears.map((year, index) => (
                <li key={index}>
                  <button
                    className="dropdown-item"
                    onClick={() => setSelectedYear(year)}
                  >
                    {year.label}
                  </button>
                </li>
              ))}
            </ul>
          ) : (
            // Afi»ôƒÉm grupele pentru anul selectat
            <ul>
              <h3>{selectedYear.label}</h3>
              {selectedYear.groups.map((group, index) => (
                <li key={index}>
                  <button
                    className="dropdown-item"
                    onClick={() => setSelectedGroup(group)}
                  >
                    {group}
                  </button>
                </li>
              ))}
              <li>
                <button
                  className="back-button"
                  onClick={() => setSelectedYear(null)} // Buton pentru a reveni la lista de ani
                >
                  √énapoi
                </button>
              </li>
            </ul>
          )}
        </div>
      )}

      {/* Afi»ôƒÉm tabelul pentru grupa selectatƒÉ */}
      {selectedGroup && (
        <div className="orar-afisat">
          <h3>Orar pentru {selectedGroup}</h3>
          <ScheduleTable
            schedule={[]} // Tabel gol
            title={`Orar pentru ${selectedGroup}`}
          />
        </div>
      )}
    </div>
  );
};

export default OrarToti;
